import React, {Component} from 'react';

class CustomerAPI extends Component{

    state={
        contacts:[]
    }
    componentDidMount(){
        fetch('http://196.121.230.1:8080/customers')
        .then(res=>res.json())
        .then((data)=>{
            this.setState({contacts:data})
        })
        .catch(console.log)
    }
    render()
{
    return(
       <div>{this.state.contacts.dob}</div>

    )
}

}

export default CustomerAPI;
